import React, { useState } from 'react';
import $ from 'jquery';
import DataTable from 'datatables.net-dt';
import './App.css';

const App = () => {
  useEffect(() => {
    const table = $('#dataTable').DataTable();
    return () => {
      table.destroy();
    };
  }, []);

  const data = [
    { patient: 'TA347', age: 30 },
    { patient: 'TA445', age: 55 }
  ];

  return (
    <div className="container">
      <h1>Patient DataTable</h1>
      <table id="dataTable" className="display">
        <thead>
          <tr>
            <th>Name</th>
            <th>Age</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.name}</td>
              <td>{row.age}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
